import axios from './axiosInstance';

const incidentsAPI = {
  getAll: async () => {
    const res = await axios.get('/incidents');
    return res.data;
  },
  create: async (incidentData) => {
    const res = await axios.post('/incidents', incidentData);
    return res.data;
  },
  delete: async (id) => {
    // Si eliminar requiere token, aquí sí lo añades
    const res = await axios.delete(`/incidents/${id}`);
    return res.data;
  }
};

export default incidentsAPI;
